import React, { useEffect, useState } from "react";
// import "./TripPhoto.css";

export default function TripPhotoPage() {
  const [trips, setTrips] = useState([]);
  const [selectedTrip, setSelectedTrip] = useState(null);
  const [photos, setPhotos] = useState([]);

  useEffect(() => {
    const fetchTrips = async () => {
      const userId = localStorage.getItem("userId");
      const res = await fetch(`http://localhost:3001/api/trip/user/${userId}`);
      const data = await res.json();
      setTrips(data);
    };
    fetchTrips();
  }, []);

  useEffect(() => {
    if (!selectedTrip) return;
    const fetchPhotos = async () => {
      const res = await fetch(`http://localhost:3001/api/photo/trip/${selectedTrip.id}`);
      const data = await res.json();
      setPhotos(data);
    };
    fetchPhotos();
  }, [selectedTrip]);

  const days = selectedTrip ? Math.ceil((new Date(selectedTrip.endDate) - new Date(selectedTrip.startDate)) / (1000 * 60 * 60 * 24)) + 1 : 0;

  return (
    <div className="photo-page">
      <h2>ðŸ“· My Travel Footprints</h2>
      <select onChange={e => {
        const trip = trips.find(t => t.id === parseInt(e.target.value));
        setSelectedTrip(trip);
      }}>
        <option value="">-- Select a Trip --</option>
        {trips.map(t => (
          <option key={t.id} value={t.id}>{t.fromCity} â†’ {t.destination}</option>
        ))}
      </select>

      {selectedTrip && Array.from({ length: days }).map((_, i) => {
        const dayPhotos = photos.filter(p => p.dayIndex === i + 1);
        return (
          <div key={i} className="photo-day">
            <h3>ðŸ“… Day {i + 1}</h3>
            <UploadPhoto tripId={selectedTrip.id} dayIndex={i + 1} onUpload={p => setPhotos(prev => [...prev, p])} />
            <div className="photo-grid">
              {dayPhotos.map(p => (
                <div key={p.id} className="photo-item">
                  <img src={p.imageUrl} alt="" />
                  {p.placeName && <p>{p.placeName}</p>}
                </div>
              ))}
            </div>
          </div>
        );
      })}
    </div>
  );
}

function UploadPhoto({ tripId, dayIndex, onUpload }) {
  const [file, setFile] = useState(null);
  const [placeName, setPlaceName] = useState("");
  const [description, setDescription] = useState("");

  const handleUpload = async () => {
    const userId = localStorage.getItem("userId");
    const formData = new FormData();
    formData.append("photo", file);
    formData.append("tripId", tripId);
    formData.append("uploadedBy", userId);
    formData.append("dayIndex", dayIndex);
    formData.append("placeName", placeName);
    formData.append("description", description);

    const res = await fetch("http://localhost:3001/api/photo", {
      method: "POST",
      body: formData,
    });
    const newPhoto = await res.json();
    onUpload(newPhoto);
    setFile(null);
    setPlaceName("");
    setDescription("");
  };

  return (
    <div className="upload-box">
      <input type="file" onChange={e => setFile(e.target.files[0])} />
      <input type="text" placeholder="Place name" value={placeName} onChange={e => setPlaceName(e.target.value)} />
      <input type="text" placeholder="Description" value={description} onChange={e => setDescription(e.target.value)} />
      <button onClick={handleUpload} disabled={!file}>Upload</button>
    </div>
  );
}
